import React from "react"
import {Grid} from "@material-ui/core"
import{SearchBar, VideoList, VideoDetail, VideoDetails} from './components'
import youtube from "./api/youtube"
 class App extends React.Component{
     handleChange = async(searchTerm)=>{
         const response= await youtube.get("search",{
            params: {
                part:"snippet",
                key:"AIzaSyAYDx8imB7PesnnRObolzC8mpZlxRsshsU",
                //eventType:"live"&&"upcoming",
                maxResults:"10",
                q:searchTerm
            }
         })
         console.log(response)

     }

    render(){
        return(
            <>
                <Grid justify="center" container spacing={10} >

                    <Grid item xs={12}>

                        <Grid container spacing={10}>

                            <Grid item xs={12}>
                                <SearchBar onFormSubmit={this.handleChange}/>
                            </Grid>
                            <Grid item xs={8}>
                                <VideoDetails/>
                            </Grid>
                            <Grid item xs={4}>

                            </Grid>
                        </Grid>
                    </Grid>
                </Grid>

            </>
        )
    }
}
export default App
